<script>
function drawcircle_a()
{
	var gameScreen = document.getElementById('myCanvas_a');
	var gameScreenPosition = gameScreen.getBoundingClientRect();
	var x = event.clientX - gameScreenPosition.left;
	var y = event.clientY - gameScreenPosition.top;
	//alert(x + ' ' + y);
	var c = document.getElementById("myCanvas_a");
	var ctx = c.getContext("2d");
	ctx.clearRect(0, 0, gameScreen.width, gameScreen.height);
	ctx.beginPath();
	//alert(ctx.beginPath());
	ctx.arc(x, y, 10, 0, 2 * Math.PI);
	ctx.fillStyle = 'red';
	ctx.fill();
	ctx.lineWidth = 0;
	ctx.strokeStyle = '';
	ctx.stroke();
}

 </script>
